CREATE TABLE ville (
    id BIGINT AUTO_INCREMENT PRIMARY KEY,
    nom VARCHAR(512),
    code_postal VARCHAR(16),
    population INT,
    region VARCHAR(512),
    latitude DOUBLE,
    longitude DOUBLE
);

